import React from 'react';

class AddTodo extends React.Component {

  render() {
    return (
      <form>
        <label >Add Todo <input type='text' id='addTodoInput' onChange={this.props.addTodo} /></label>
        <input type='submit' />
      </form>
    )
  };
};

export default AddTodo;
